import styled from 'styled-components'

export const Tile = styled.div`
    width: 300px;
    height: 150px;
    border-radius: 6px;
    margin-right: 12px;
    margin-top: 20px;
    background-color: white;
    display: flex;
    justify-content: center;
    align-items:center; 
    cursor: pointer;
`;

export const OperatorImg = styled.img`
    width: 100px;
`;
